import { Link } from 'react-router-dom';
import foto_jv from './img/Foto_portfolio_ab.png'
import './style.css';

function Home(){
    return (
        <div>
            <h1>Olá. Sou um Desenvolvedor e Editor!</h1>
                <p>Meu nome é João Vitor P. Silva. Sou um Desenvolvedor e Editor, que está sempre em busca de aprender e melhorar!</p>
                <button> Vamos tabalhar juntos!</button>
                <img className='jv_img' src={foto_jv}/>
        </div>
    );
}

export default Home;
